
const frame = document.getElementById('device-frame');
const canvas = document.getElementById('gameCanvas');
const ctx = canvas.getContext('2d');

const LOGICAL_WIDTH = 390;
const LOGICAL_HEIGHT = 844;

canvas.width = LOGICAL_WIDTH;
canvas.height = LOGICAL_HEIGHT;

function resize() {
  const aspect = LOGICAL_WIDTH / LOGICAL_HEIGHT;
  let w = window.innerWidth;
  let h = window.innerHeight;
  
  // Padding
  w -= 40;
  h -= 40;
  
  let scale = 1;
  if (w / h > aspect) {
    scale = h / LOGICAL_HEIGHT;
  } else {
    scale = w / LOGICAL_WIDTH;
  }
  
  if (scale > 1) scale = 1;
  
  frame.style.transform = `translate(-50%, -50%) scale(${scale})`;
}
window.addEventListener('resize', resize);
resize();

const spritesData = [{"id":"fz1nx","name":"1000000504","dataUrl":"data:image/jpeg;base64,","width":590,"height":761}];
const instancesData = [{"id":"xbpj8","spriteId":"fz1nx","x":68.90640757550759,"y":311.5969877439125,"width":590,"height":761,"rotation":0,"scale":1,"opacity":1,"visible":true,"layer":"Default","zIndex":0,"variables":{},"scaleX":0.3,"scaleY":0.3}];
const eventsData = [{"id":"lckhgf","condition":{"id":"mwp27","type":"click","targetId":"fz1nx"},"actions":[{"id":"lmpkhe","type":"customJs","value":""}]}];

const loadedImages = {};
let imagesLoaded = 0;

// Global Variables
const variables = {};

let instances = instancesData.map(inst => ({
  ...inst,
  rotation: inst.rotation || 0,
  scaleX: inst.scaleX !== undefined ? inst.scaleX : (inst.scale || 1),
  scaleY: inst.scaleY !== undefined ? inst.scaleY : (inst.scale || 1),
  opacity: inst.opacity !== undefined ? inst.opacity : 1,
  layer: inst.layer || 'Default',
  zIndex: inst.zIndex || 0,
  variables: {}
}));

// Input state
const input = { x: 0, y: 0, isDown: false, wasDown: false, clicked: false, keys: {}, justPressedKeys: {}, justReleasedKeys: {} };

function updateInputPos(e) {
  const rect = canvas.getBoundingClientRect();
  const scaleX = canvas.width / rect.width;
  const scaleY = canvas.height / rect.height;
  input.x = (e.clientX - rect.left) * scaleX; 
  input.y = (e.clientY - rect.top) * scaleY; 
}

window.addEventListener('pointerdown', e => { 
  updateInputPos(e);
  input.isDown = true; 
  input.clicked = true; 
  runEvents('pointerdown');
  runEvents('click');
});
window.addEventListener('pointermove', e => { 
  updateInputPos(e);
});
window.addEventListener('pointerup', e => { 
  input.isDown = false; 
  runEvents('pointerup');
});
window.addEventListener('keydown', e => { 
  input.keys[e.key] = true; 
  input.justPressedKeys[e.key] = true; 
  runEvents('keydown', e);
});
window.addEventListener('keyup', e => { 
  input.keys[e.key] = false; 
  input.justReleasedKeys[e.key] = true; 
  runEvents('keyup', e);
});

// Timers
const timers = {};
let lastTime = performance.now();
let deltaTime = 0;

// Camera
const camera = { x: 0, y: 0, zoom: 1, shake: 0 };

// Audio
const audioCtx = new (window.AudioContext || window.webkitAudioContext)();
function playTone(freq = 440, type = 'sine', duration = 0.1, volume = 0.1) {
  const osc = audioCtx.createOscillator();
  const gain = audioCtx.createGain();
  osc.type = type;
  osc.frequency.setValueAtTime(freq, audioCtx.currentTime);
  gain.gain.setValueAtTime(volume, audioCtx.currentTime);
  gain.gain.exponentialRampToValueAtTime(0.01, audioCtx.currentTime + duration);
  osc.connect(gain);
  gain.connect(audioCtx.destination);
  osc.start();
  osc.stop(audioCtx.currentTime + duration);
}

function checkCollision(inst1, inst2) {
  if (!inst1.visible || !inst2.visible) return false;
  const w1 = inst1.width * inst1.scaleX;
  const h1 = inst1.height * inst1.scaleY;
  const w2 = inst2.width * inst2.scaleX;
  const h2 = inst2.height * inst2.scaleY;
  return inst1.x < inst2.x + w2 &&
         inst1.x + w1 > inst2.x &&
         inst1.y < inst2.y + h2 &&
         inst1.y + h1 > inst2.y;
}

function compare(val1, operator, val2) {
  if (operator === '==' || operator === '!=') {
    // Loose equality for strings/numbers
    if (operator === '==') return val1 == val2;
    if (operator === '!=') return val1 != val2;
  }
  
  const v1 = Number(val1);
  const v2 = Number(val2);
  if (isNaN(v1) || isNaN(v2)) return false;
  
  if (operator === '>') return v1 > v2;
  if (operator === '<') return v1 < v2;
  if (operator === '>=') return v1 >= v2;
  if (operator === '<=') return v1 <= v2;
  return false;
}

function executeActions(actionsList, context) {
  const actions = [...actionsList];
  
  const runNext = () => {
    if (actions.length === 0) return;
    const action = actions.shift();

    if (action.type === 'wait') {
      setTimeout(runNext, (Number(action.value) || 1) * 1000);
      return;
    }

    if (action.type === 'customJs') {
      try {
        // Provide a persistent global scope if needed
        if (!window.customJsGlobal) window.customJsGlobal = {};
        
        const AsyncFunction = Object.getPrototypeOf(async function(){}).constructor;
        const fn = new AsyncFunction('instances', 'target', 'input', 'ctx', 'canvas', 'deltaTime', 'camera', 'audioCtx', 'variables', 'window', 'document', 'global', 'container', action.value || '');
        const result = fn(instances, context.target || context.target1, input, ctx, canvas, deltaTime, camera, audioCtx, variables, window, document, window.customJsGlobal, document.getElementById('app-container'));
        
        if (result instanceof Promise) {
          result.then(runNext).catch(e => {
            console.error("Custom JS Error in action " + action.id + ":", e);
            runNext();
          });
          return;
        }
      } catch(e) { 
        console.error("Custom JS Error in action " + action.id + ":", e); 
      }
      runNext();
      return;
    }
    
    if (action.type === 'spawn') {
      instances.push({
        id: Math.random().toString(36).substring(7),
        spriteId: action.targetId,
        x: Number(action.value) || 0,
        y: Number(action.value2) || 0,
        width: 50, height: 50, rotation: 0, scaleX: 1, scaleY: 1, opacity: 1, visible: true,
        layer: 'Default', zIndex: 0, variables: {}
      });
      runNext();
      return;
    }

    if (action.type === 'playSound') {
      playTone(Number(action.value) || 440, 'sine', 0.2);
      runNext();
      return;
    }

    if (action.type === 'log') {
      console.log(action.value);
      runNext();
      return;
    }

    if (action.type === 'cameraFollow') {
      const target = instances.find(i => i.spriteId === action.targetId);
      if (target) {
        camera.x = target.x + (target.width * target.scaleX)/2 - LOGICAL_WIDTH/2;
        camera.y = target.y + (target.height * target.scaleY)/2 - LOGICAL_HEIGHT/2;
      }
      runNext();
      return;
    }

    if (action.type === 'cameraZoom') {
      camera.zoom = Number(action.value) || 1;
      runNext();
      return;
    }

    if (action.type === 'cameraMoveTo') {
      camera.x = Number(action.value) || 0;
      camera.y = Number(action.value2) || 0;
      runNext();
      return;
    }

    if (action.type === 'shakeCamera') {
      camera.shake = Number(action.value) || 10;
      runNext();
      return;
    }

    if (action.type === 'restartScene') {
      location.reload();
      return; // Stop execution
    }
    
    if (action.type === 'quitGame') {
      // window.close() often blocked, but we can try or just stop loop
      cancelAnimationFrame(loop);
      return;
    }

    if (action.type === 'setVariable') {
      variables[action.value] = action.value2;
      runNext();
      return;
    }

    if (action.type === 'addVariable') {
      variables[action.value] = (Number(variables[action.value]) || 0) + (Number(action.value2) || 0);
      runNext();
      return;
    }

    if (action.type === 'subtractVariable') {
      variables[action.value] = (Number(variables[action.value]) || 0) - (Number(action.value2) || 0);
      runNext();
      return;
    }

    const targets = action.targetId ? instances.filter(i => i.spriteId === action.targetId) : [];
    for (const target of targets) {
      if (action.type === 'moveX') target.x += Number(action.value) || 0;
      if (action.type === 'moveY') target.y += Number(action.value) || 0;
      if (action.type === 'setX') target.x = Number(action.value) || 0;
      if (action.type === 'setY') target.y = Number(action.value) || 0;
      if (action.type === 'rotate') target.rotation += Number(action.value) || 0;
      if (action.type === 'setScale') {
        const val = Number(action.value) || 1;
        target.scaleX = val;
        target.scaleY = val;
      }
      if (action.type === 'setOpacity') target.opacity = Number(action.value) || 1;
      if (action.type === 'setVisible') target.visible = action.value === 'true';
      if (action.type === 'toggleVisible') target.visible = !target.visible;
      if (action.type === 'setLayer') target.layer = action.value;
      if (action.type === 'setZIndex') target.zIndex = Number(action.value) || 0;
      if (action.type === 'bringToFront') target.zIndex = 1000;
      if (action.type === 'sendToBack') target.zIndex = -1000;
      if (action.type === 'setSize') {
        const size = Number(action.value) || 1;
        target.scaleX = size;
        target.scaleY = size;
      }
      if (action.type === 'setWidth') {
        if (target.width) target.scaleX = (Number(action.value) || 50) / target.width;
      }
      if (action.type === 'setHeight') {
        if (target.height) target.scaleY = (Number(action.value) || 50) / target.height;
      }
      
      if (action.type === 'lookAt') {
        const target2 = instances.find(i => i.spriteId === action.value);
        if (target2) {
          const dx = target2.x - target.x;
          const dy = target2.y - target.y;
          target.rotation = Math.atan2(dy, dx) * 180 / Math.PI;
        }
      }
      if (action.type === 'moveTowards') {
        const target2 = instances.find(i => i.spriteId === action.value);
        if (target2) {
          const dx = target2.x - target.x;
          const dy = target2.y - target.y;
          const dist = Math.sqrt(dx*dx + dy*dy);
          if (dist > 0) {
            const speed = Number(action.value2) || 1;
            target.x += (dx/dist) * speed;
            target.y += (dy/dist) * speed;
          }
        }
      }
      if (action.type === 'moveForward') {
        const rad = (target.rotation || 0) * Math.PI / 180;
        const speed = Number(action.value) || 0;
        target.x += Math.cos(rad) * speed;
        target.y += Math.sin(rad) * speed;
      }
      if (action.type === 'destroy') {
        instances = instances.filter(i => i !== target);
      }
    }
    if (action.type === 'alert') alert(action.value);
    
    runNext();
  };
  
  runNext();
}

function runEvents(type, eventObj) {
  for (const ev of eventsData) {
    if (ev.condition.type === type) {
      if (type === 'click' || type === 'pointerdown' || type === 'pointerup') {
        const isTriggered = 
          (type === 'click' && input.clicked) || 
          (type === 'pointerdown' && input.isDown && !input.wasDown) || 
          (type === 'pointerup' && !input.isDown && input.wasDown);

        if (isTriggered) {
          const worldX = (input.x + camera.x) / camera.zoom;
          const worldY = (input.y + camera.y) / camera.zoom;

          if (ev.condition.targetId) {
            const targets = instances.filter(i => i.spriteId === ev.condition.targetId);
            for (const t of targets) {
              if (!t.visible) continue;
              const w = t.width * t.scaleX;
              const h = t.height * t.scaleY;
              if (worldX >= t.x && worldX <= t.x + w && worldY >= t.y && worldY <= t.y + h) {
                executeActions(ev.actions, { target: t });
              }
            }
          } else {
            executeActions(ev.actions, {});
          }
        }
      } else if (type === 'collision') {
        const targets1 = instances.filter(i => i.spriteId === ev.condition.targetId);
        const targets2 = instances.filter(i => i.spriteId === ev.condition.targetId2);
        for (const t1 of targets1) {
          for (const t2 of targets2) {
            if (checkCollision(t1, t2)) {
              executeActions(ev.actions, { target1: t1, target2: t2 });
            }
          }
        }
      } else if (type === 'keydown') {
        if (eventObj ? eventObj.key === ev.condition.value : input.justPressedKeys[ev.condition.value]) {
          executeActions(ev.actions, {});
        }
      } else if (type === 'keyup') {
        if (eventObj ? eventObj.key === ev.condition.value : input.justReleasedKeys[ev.condition.value]) {
          executeActions(ev.actions, {});
        }
      } else if (type === 'timer') {
        const timerId = ev.id;
        if (!timers[timerId]) timers[timerId] = 0;
        timers[timerId] += deltaTime;
        const interval = (Number(ev.condition.value) || 1) * 1000;
        if (timers[timerId] >= interval) {
          timers[timerId] = 0;
          executeActions(ev.actions, {});
        }
      } else if (type === 'update') {
         executeActions(ev.actions, {});
      } else if (type.startsWith('compare') || type === 'isVisible' || type === 'isFlipped' || type === 'onScreen') {
         const targets = ev.condition.targetId ? instances.filter(i => i.spriteId === ev.condition.targetId) : [];
         for (const t of targets) {
            let met = false;
            if (type === 'compareX') met = compare(t.x, ev.condition.operator, ev.condition.value);
            if (type === 'compareY') met = compare(t.y, ev.condition.operator, ev.condition.value);
            if (type === 'compareOpacity') met = compare(t.opacity, ev.condition.operator, ev.condition.value);
            if (type === 'compareScale') met = compare(t.scaleX, ev.condition.operator, ev.condition.value);
            if (type === 'compareRotation') met = compare(t.rotation, ev.condition.operator, ev.condition.value);
            if (type === 'compareLayer') met = t.layer === ev.condition.value;
            if (type === 'compareZIndex') met = compare(t.zIndex, ev.condition.operator, ev.condition.value);
            if (type === 'isVisible') met = t.visible === (ev.condition.value === 'true');
            if (type === 'isFlipped') met = false; // Not implemented yet
            if (type === 'onScreen') {
               // Simple AABB check with camera
               const w = t.width * t.scaleX;
               const h = t.height * t.scaleY;
               met = (t.x + w > camera.x && t.x < camera.x + LOGICAL_WIDTH &&
                      t.y + h > camera.y && t.y < camera.y + LOGICAL_HEIGHT);
            }
            
            if (met) executeActions(ev.actions, { target: t });
         }
      } else if (type === 'distanceTo') {
         const targets1 = instances.filter(i => i.spriteId === ev.condition.targetId);
         const targets2 = instances.filter(i => i.spriteId === ev.condition.targetId2);
         
         for (const t1 of targets1) {
           for (const t2 of targets2) {
             const dx = t1.x - t2.x;
             const dy = t1.y - t2.y;
             const dist = Math.sqrt(dx*dx + dy*dy);
             if (compare(dist, ev.condition.operator, ev.condition.value)) {
               executeActions(ev.actions, { target1: t1, target2: t2 });
             }
           }
         }
      } else if (type === 'variableCompare') {
        if (compare(variables[ev.condition.value] || 0, ev.condition.operator, ev.condition.value2)) { // Need value2
           executeActions(ev.actions, {});
        }
      } else if (type === 'objectVariableCompare') {
         const targets = ev.condition.targetId ? instances.filter(i => i.spriteId === ev.condition.targetId) : [];
         for (const t of targets) {
            if (compare(t.variables[ev.condition.value] || 0, ev.condition.operator, ev.condition.value2)) {
               executeActions(ev.actions, { target: t });
            }
         }
      } else if (type === 'randomChance') {
        if (Math.random() < (Number(ev.condition.value) || 0.5)) {
           executeActions(ev.actions, {});
        }
      } else {
        executeActions(ev.actions, {});
      }
    }
  }
}

function init() {
  console.log("Engine started");
  runEvents('start');
  requestAnimationFrame(loop);
}

function loop(time) {
  deltaTime = time - lastTime;
  lastTime = time;
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  
  // Camera Shake decay
  if (camera.shake > 0) {
    camera.x += (Math.random() - 0.5) * camera.shake;
    camera.y += (Math.random() - 0.5) * camera.shake;
    camera.shake *= 0.9;
    if (camera.shake < 0.5) camera.shake = 0;
  }

  runEvents('update');
  
  // Run property checks
  const propChecks = ['compareX', 'compareY', 'compareOpacity', 'compareScale', 'compareRotation', 'compareLayer', 'compareZIndex', 'isVisible', 'onScreen', 'distanceTo', 'randomChance', 'variableCompare'];
  propChecks.forEach(check => runEvents(check));
  
  runEvents('timer');
  
  ctx.save();
  // Apply Camera
  ctx.translate(-camera.x, -camera.y);
  ctx.scale(camera.zoom, camera.zoom);

  // Sort instances by Z-Index
  const sortedInstances = [...instances].sort((a, b) => (a.zIndex || 0) - (b.zIndex || 0));

  for (const inst of sortedInstances) {
    if (!inst.visible && inst.visible !== undefined) continue;
    if (inst.visible === undefined) inst.visible = true;

    if (loadedImages[inst.spriteId]) {
      ctx.save();
      ctx.globalAlpha = inst.opacity !== undefined ? inst.opacity : 1;
      const width = inst.width * inst.scaleX;
      const height = inst.height * inst.scaleY;
      ctx.translate(inst.x + width/2, inst.y + height/2);
      ctx.rotate((inst.rotation || 0) * Math.PI / 180);
      ctx.drawImage(loadedImages[inst.spriteId], -width/2, -height/2, width, height);
      ctx.restore();
    }
  }
  ctx.restore();
  
  input.clicked = false;
  input.wasDown = input.isDown;
  input.justPressedKeys = {};
  input.justReleasedKeys = {};
  requestAnimationFrame(loop);
}

if (spritesData.length === 0) {
  init();
} else {
  for (const sprite of spritesData) {
    const img = new Image();
    img.onload = () => {
      loadedImages[sprite.id] = img;
      imagesLoaded++;
      if (imagesLoaded === spritesData.length) init();
    };
    img.onerror = () => {
      console.error("Failed to load sprite:", sprite.name);
      imagesLoaded++;
      if (imagesLoaded === spritesData.length) init();
    };
    img.src = sprite.dataUrl;
  }
}
  